const SerieInfo = () => {
    const [serie, setSerie] = useState(null);
  
    useEffect(() => {
      const fetchSerieInfo = async () => {
        try {
          const response = await axios.get(
            'https://api.themoviedb.org/3/tv/1402?api_key=1402'
          );
          setSerie(response.data);
        } catch (error) {
          console.error(error);
        }
      };
  
      fetchSerieInfo();
    }, []);
  
    return (
      <div>
        {serie && (
          <div>
            <h2>{serie.name}</h2>
            <p>{serie.overview}</p>
            {/* Otros detalles de la serie */}
          </div>
        )}
      </div>
    );
  };

  export default Serie;
